CREATE DEFINER=`root`@`localhost` FUNCTION `func_complete_sale`(p_client_id int,p_sale_id int(11),p_empoyee_id int) RETURNS smallint(6)
BEGIN    
    
    DECLARE v_return_id SMALLINT(6);
    declare v_trans_dateime datetime;
    declare v_payment_amount, v_payment_amount_1 decimal(15,2);
    
    SET v_return_id=1;
    set v_trans_dateime = now();
     
        
    insert into `account_receivable`(`account_id`,`client_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
    SELECT account_id,client_id,employee_id,sale_id,amount,'CHSALE' trans_code,sale_time,'N' trans_status
    from v_sale_account
    where sale_id=p_sale_id;
	 
    
    update account c, v_sale_account sa
    set c.current_balance = c.current_balance + sa.amount
    where c.id = sa.account_id
    and sa.sale_id=p_sale_id;
      
    RETURN v_return_id;    
    
    END ;;
