CREATE DEFINER=`homestead`@`%` FUNCTION `func_payment`(p_client_id INT(11),p_currency_code smallint(6),p_payment_amount DECIMAL(15,2),p_empoyee_id INT(11),p_note varchar(100)) RETURNS smallint(6)
BEGIN
  DECLARE v_sale_id, v_client_id, v_currency_code,v_payment_id,v_account_id,v_return_id INT(11);
  DECLARE done smallint(6) default false;
  DECLARE v_payment_amount,v_balance DECIMAL(15,2);
  DECLARE v_sale_time,v_tran_datetime DATETIME;
    
  
  DECLARE cur1 CURSOR FOR SELECT s.sale_id,s.sale_time,s.currency_code,s.client_id,s.balance
  FROM `v_sale_outstanding` s
  WHERE s.client_id = p_client_id
  AND s.currency_code=p_currency_code
  AND s.balance > 0;
  
  
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  
  SET v_payment_amount := p_payment_amount; 
  SET v_tran_datetime := NOW();
  SET v_return_id:=1;
 
  
  SELECT id INTO v_account_id FROM account WHERE client_id=p_client_id AND currency_code=p_currency_code;
  
  
  UPDATE account 
  SET current_balance = current_balance - v_payment_amount
  WHERE id = v_account_id;
  
  
  INSERT INTO payment_history(`client_id`,currency_code,`payment_amount`,`give_away`,`date_paid`,`employee_id`,note)
  VALUES (p_client_id,p_currency_code,p_payment_amount,0,v_tran_datetime,p_empoyee_id,p_note);
  
  SELECT LAST_INSERT_ID() INTO v_payment_id;
  
  
  OPEN cur1;
 
  
  the_loop: LOOP
 
    
    FETCH cur1 INTO v_sale_id,v_sale_time,v_currency_code,v_client_id,v_balance;
    IF done THEN
      LEAVE the_loop;
    END IF;
 
    
    IF v_payment_amount<=v_balance THEN
	
	INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`,note)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_payment_amount,0,v_tran_datetime,v_tran_datetime,p_note);
	INSERT INTO `account_receivable`(`account_id`,client_id,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`,note)
	VALUES (v_account_id,p_client_id,p_empoyee_id,v_sale_id,v_payment_amount,'PAY',v_tran_datetime,'N',p_note);
	
	SET done = TRUE;
    ELSE 
        SET v_payment_amount:= v_payment_amount - v_balance;
        INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`,note)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_balance,0,v_tran_datetime,v_tran_datetime,p_note);	
	INSERT INTO `account_receivable`(`account_id`,client_id,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`,note)
	VALUES (v_account_id,p_client_id,p_empoyee_id,v_sale_id,v_balance,'PAY',v_tran_datetime,'N',p_note);	
	
    END IF;
 
  END LOOP the_loop;
   
  CLOSE cur1;
  
  RETURN v_return_id;
  
  END ;;
DELIMITER ;
