CREATE DEFINER=`homestead`@`%` FUNCTION `func_reset_client_balance`(p_client_id int) RETURNS varchar(15) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
BEGIN
	
	declare v_client_id int;
	set v_client_id = p_client_id;
    
	
	UPDATE `account` SET current_balance = 0 WHERE client_id = v_client_id;
	
	DELETE FROM `account_receivable` WHERE client_id = v_client_id;
	
	DELETE FROM `sale` WHERE client_id = v_client_id;
	
	return '0';
    END ;;
DELIMITER ;
