CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_payment`(p_client_id INT,p_currency_code INT,p_payment_amount DECIMAL(15,2),p_empoyee_id INT)
BEGIN
  DECLARE v_sale_id, v_client_id, v_currency_code,v_payment_id,v_account_id INT;
  DECLARE done INT DEFAULT FALSE;
  DECLARE v_payment_amount,v_balance DECIMAL(15,2);
  DECLARE v_sale_time,v_tran_datetime DATETIME;
 
  
  DECLARE cur1 CURSOR FOR SELECT s.sale_id,s.sale_time,s.currency_code,client_id,( s.total-IFNULL(sp.payment_amount,0) ) balance
  FROM (SELECT s.id sale_id,s.sale_time,s.client_id,s.employee_id,si.currency_code,SUM(si.quantity*si.price) total
        FROM sale s, sale_item si
        WHERE s.id = si.sale_id
        AND s.client_id = p_client_id
        AND si.currency_code=p_currency_code
        GROUP BY s.id,s.sale_time,s.client_id,si.currency_code,s.employee_id
    ) s LEFT JOIN v_sale_payment sp ON sp.sale_id=s.sale_id AND s.currency_code = sp.currency_code
  WHERE ( s.total-IFNULL(sp.payment_amount,0) ) > 0;
  
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  
  SET v_payment_amount := p_payment_amount;
  SET v_tran_datetime := NOW();
  
  SELECT id INTO v_account_id FROM account WHERE client_id=p_client_id AND currency_code=p_currency_code;
  
  
  UPDATE account 
  SET current_balance = current_balance - p_payment_amount
  WHERE id = v_account_id;
  
  
  INSERT INTO payment_history(`client_id`,currency_code,`payment_amount`,`give_away`,`date_paid`,`employee_id`)
  VALUES (p_client_id,p_currency_code,p_payment_amount,0,v_tran_datetime,p_empoyee_id);
  
  SELECT LAST_INSERT_ID() INTO v_payment_id;
  
  
  OPEN cur1;
 
  
  the_loop: LOOP
 
    
    FETCH cur1 INTO v_sale_id,v_sale_time,v_currency_code,v_client_id,v_balance;
    IF done THEN
      LEAVE the_loop;
    END IF;
 
    
    IF v_payment_amount<=v_balance THEN
	
	INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_payment_amount,0,v_tran_datetime,v_tran_datetime);
	INSERT INTO `account_receivable`(`account_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
	VALUES (v_account_id,p_empoyee_id,v_sale_id,v_payment_amount,'PAY',v_tran_datetime,'N');
	
	SET done = TRUE;
    ELSE 
        SET v_payment_amount:= v_payment_amount - v_balance;
        INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_balance,0,v_tran_datetime,v_tran_datetime);	
	INSERT INTO `account_receivable`(`account_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
	VALUES (v_account_id,p_empoyee_id,v_sale_id,v_balance,'PAY',v_tran_datetime,'N');	
	
    END IF;
 
  END LOOP the_loop;
   
  CLOSE cur1;
  END ;;
